  inline const RoboclawConfigStatics *RoboclawConfig::__get_statics__()
  {
    const static RoboclawConfigStatics *statics;
  
    if (statics) // Common case
      return statics;

    boost::mutex::scoped_lock lock(dynamic_reconfigure::__init_mutex__);

    if (statics) // In case we lost a race.
      return statics;

    statics = RoboclawConfigStatics::get_instance();
    
    return statics;
  }


